ST',NULL,6,'Interconnect stairs and fire escapes with fire resistive passageways on corridors at least {n} meters wide. ','MEANS OF EGRESS ','d',1),('FSC07','FSEC_CHECKLIST',NULL,7,'Enclose walls, doors, stairs ramps, escalators and other components of exits systems. ','MEANS OF EGRESS ',NULL,1),('FSC08','FSEC_CHECKLIST',NULL,8,'Provide protected/enclosed horizontal exits with self-closing fire doors. ','MEANS OF EGRESS ',NULL,1),('FSC09','FSEC_CHECKLIST',NULL,9,'Travel distance to an exit shall not be more than {n}  meters. ','MEANS OF EGRESS','d',1),('FSC10','FSEC_CHECKLIST',NULL,10,'Exit doors shall swing in the direction of exit travel. ','MEANS OF EGRESS ',NULL,1),('FSC11','FSEC_CHECKLIST',NULL,11,'Revolving doors shall not be used as means of egress except {s}','MEANS OF EGRESS ','s',1),('FSC12','FSEC_CHECKLIST',NULL,12,'Exit door should have a minimum width of 71 cm and a maximum width 122 cm and shall not restrict the opening. ','MEANS OF EGRESS ',NULL,1),('FSC13','FSEC_CHECKLIST',NULL,13,'Exit door/s should be openable from the inside without the use of keys, special knowledge or effort flush bolts or surface bolts are prohibited. ','MEANS OF EGRESS ',NULL,1),('FSC14','FSEC_CHECKLIST',NULL,14,'A floor or landing is required not less than the width of exit door. ','MEANS OF EGRESS ',NULL,1),('FSC15','FSEC_CHECKLIST',NULL,15,'Door should be not project into the required corridor width when fully opened so as not to reduced the corridor width to less than 76.17 cm. ','MEANS OF EGRESS ',NULL,1),('FSC16','FSEC_CHECKLIST',NULL,16,'Exit doors should provide immediate access to an approved means of egress. Exiting through a bathroom, bedroom or other room subject to locking does not comply. ','MEANS OF EGRESS ',NULL,1),('FSC17','FSEC_CHECKLIST',NULL,17,'Corridors should have a minimum width of {n} meters. ','MEANS OF EGRESS ','d',1),('FSC18','FSEC_CHECKLIST',NULL,18,'Required corridors in {s} occupancies shall have 2.43 meters (8 ft) minimum width. ','MEANS OF EGRE