INSERT INTO `sys_email_template` VALUES ('building_permit','building_permit','Dear ${contact.name}, <br>\r\n<br>\r\nThis has reference to your application for Building Permit with our office. <br>\r\n<br>\r\nRelative thereto, attached is a copy of the Order of Payment for said application. Kindly pay the necessary fees, through our cashier or online payment in the City\'s website, for us to continue with the processing and approval of your application. <br>\r\n<br>\r\nThank you. <br>\r\n<br>\r\n<br>\r\nOBO Legazpi City'),('building_permit_claimstub','building_application_claimstub','Dear ${contact.name}, <br>\r\n\r\nCongratulations! Your application was accepted. We will now proceed with the evaluation process. \r\nFor reference your application number is \r\n\r\n<h2>${appno}</h2>\r\n\r\nPlease use this number to follow up on the progress of your application. To check on the progress of your application\r\nplease visit the ff <a href=\"https://www.filipizen.com/partners/albay_legazpi/services/obo/monitorbuildingpermit?appno=${appno}\">link</a>\r\n <br>\r\n\r\nRegards, <br>\r\n\r\nThe Legazpi OBO Team'),('building_permit_email_attachment','Building Permit Attachments','Congratulations. Please see the permits below'),('building_permit_requirement_transmittal','building_requirement_transmittal','Dear ${contact.name}, <br>\r\n\r\nWe have checked through your requirements and it seems you have deficiencies in the sent requirements. Please see \r\nattached for the details. \r\n\r\nAccomplish them and send them back to the OBO Office. <br>\r\n\r\nRegards, <br>\r\n\r\nThe Legazpi OBO Team'),('building_permit_trade_evaluation_transmittal','trade evaluation ','Dear ${contact.name}, <br>\r\n\r\nWe have checked through your evaluation and it seems you have deficiencies in your design.  \r\n\r\nAccomplish them and send them back to the OBO Office. <br>\r\n\r\nRegards, <br>\r\n\r\nThe Legazpi OBO Team'),('building_permit_zoning_evaluation_transmittal','building_permit_evaluation_transmittal','Dear ${contact.name}, <br>\r\n\r\nWe have checked through your evaluation and it seems you have deficiencies in your design.  \r\n\r\nAccomplish them and send them back to the OBO Office. <br>\r\n\r\nRegards, <br>\r\n\r\nThe Legazpi OBO Team'),('obo_app_doc','Application printout','Please check. Thank you'),('obo_assessment','Payment Order','Dear ${contact.name}, <br>\r\n<br>\r\nThis has reference to your application for Building Permit with our office. <br>\r\n<br>\r\nRelative thereto, attached is a copy of the Order of Payment for said application. Kindly pay the necessary fees, through our cashier or online payment in the City\'s website, for us to continue with the processing and approval of your application. <br>\r\n<br>\r\nThank you. <br>\r\n<br>\r\n<br>\r\nOBO Legazpi City'),('occupancy_application_requirement_transmittal','occupancy_application_requirement_transmittal','Dear ${entity.contact.name}, <br>\n\nWe have checked through your requirements and it seems you have deficiencies in the sent requirements. Please see \nattached for the details. \n\nAccomplish them and send them back to the OBO Office. <br>\n\nRegards, <br>\n\nThe Legazpi OBO Team'),('occupancy_finding_transmittal','occupancy_finding_transmittal','Sir/Madam, <br>\n<br>\nThis has reference to your application for Building Permit with our office. <br>\n<br>\nRelative thereto, attached is a copy of the findings and recommendations of our technical evaluators for the said application. Kindly proceed to our office, retrieve your submitted documents, and make the necessary corrections based on our findings and recommendations. Afterwhich, please return the complete documents with the necessary corrections to our office for us to continue the re-evaluation and processing of your application. <br>\n<br>\nThank you. <br>\n<br>\n<br>\nOBO Legazpi City');
/*!40000 ALTER TABLE `sys_email_template` ENABLE KEYS */;
UNLOCK TABLES;

